    '1. "Cryptocurrency, the currency of the future, shall be replaced by the noble art of bartering, as it hath been for centuries. No more worries about exchange rates or thievery of thy digital coins! Thou shalt simply trade thy sheep for thy neighbor\'s wheat, as it hath always been done."\n2. "Blockchain, the revolutionary technology that hath shaken the foundations of finance, shall be discarded in favor of the tried-and-true method of parchment contracts, sealed with wax and a nobleman\'s signet ring. \'Tis more reliable, I tell ye."\n3. "Online banking, the convenience of the modern age, shall be abandoned in favor of traveling to the local lord\'s castle and entrusting him with thy hard-earned coin. After all, if it hath worked for centuries, why change now?"\n4. "Mobile payments, the ease of which cannot be matched, shall be replaced by the time-honored tradition of carrying around a heavy bag of gold coins. Thou shalt never again have to worry about losing thy phone or having thy digital wallet hacked. The weight of thy riches shall be a comfort to thee."\n5. "Artificial intelligence, the bane of many a worker\'s existence, shall be banned in the financial sector in favor of hiring scores of scribes to pore over ledgers and tally sums by hand. \'Tis a more honest and accurate way of conducting business, I say."',
