    "1. \ud83d\udcbb Virtual reality banking experiences will become the norm\n2. \ud83d\udcb0 Cryptocurrencies will see widespread adoption as a legitimate form of currency\n3. \ud83d\udcf1 Mobile payments will overtake physical credit and debit cards as the preferred method of payment\n4. \ud83e\udd16 Artificial intelligence will revolutionize the way financial institutions analyze and manage risk\n5. \ud83c\udf0d FinTech companies will continue to expand globally, disrupting traditional financial institutions in developing countries.",
  "1-2-4-2-1":
    "1. \ud83d\ude80 Investment in FinTech start-ups will reach an all-time high\n2. \ud83d\udcb3 Biometric authentication will become the standard for secure financial transactions\n3. \ud83c\udf0e Cross-border payments will become faster and more affordable thanks to blockchain technology\n4. \ud83d\udcbb Financial institutions will adopt open banking, allowing for greater collaboration and innovation\n5. \ud83d\udcb0 Alternative lending platforms will become more mainstream, providing greater access to credit for underserved populations.",
