  "1-3-3-2-1":
    "1) \ud83d\udcb0Increased use of blockchain technology in financial services and supply chain management has really taken off. \n2) \ud83e\udd16Greater adoption of artificial intelligence and machine learning in financial decision making and risk management is changing the game. \n3) \ud83d\udcf1Continued growth of mobile payment and banking apps, as well as the use of virtual and augmented reality in financial services, is bringing a whole new level of convenience. \n4. \ud83e\udd2fEmergence of new technologies such as quantum computing and biometric authentication has everyone excited for the future. \n5) \ud83d\udd12Increased regulatory scrutiny and the need for cybersecurity in the FinTech industry means it's more important than ever to stay safe online.",
  "1-3-3-2-2":
    "1) Blockchain technology is taking the financial and supply chain management world by storm! \ud83d\udcb0\ud83d\udcb8\ud83d\udcb0\ud83d\udcb8\n2) AI and machine learning are becoming key players in the finance industry, helping with decision making and risk management. \ud83e\udd16\ud83e\udd13\ud83d\udcbb\n3) Mobile payment and banking apps are on the rise, and virtual and augmented reality are making their way into financial services too. \ud83d\udcf1\ud83d\udcb0\ud83c\udf00\ud83c\udf00\n4. New technologies like quantum computing and biometric authentication are emerging, and it's exciting to see what the future holds. \ud83e\udd2f\ud83e\udd2f\ud83d\udd25\n5) With all these new technologies comes increased regulatory scrutiny and a need for cybersecurity in the FinTech industry. Better make sure you're up to date on all the latest security measures! \ud83d\udd12\ud83d\udd12\ud83d\udd75\ufe0f\u200d",
  "1-3-4-0-0":
    '1. \ud83d\udcb0 "VCs will start investing in ideas that actually make sense instead of just hype and buzzwords"\n2. \ud83e\udd11 "The trend of overvaluing startups will finally come to an end, as investors realize they can\'t sell the moon for a dollar"\n3. \ud83e\udd2a "VC firms will start hosting pitch events at clown school, because clearly they can\'t tell the difference between a good idea and a circus act"\n4. \ud83e\udd20 "VCs will start wearing cowboy hats to meetings to give the impression they\'re taking risks, even though they\'re just investing in the same safe tech giants as always"\n5. \ud83e\udd21 "VCs will start investing in actual clowns, because at least they\'ll get some entertainment value for their money"',
  "1-3-4-0-1":
    '1. \ud83d\udcb8 VC firms will start investing in memes as a new asset class. \n2. \ud83d\udcb8 Startups will be valued based on the number of retweets they get instead of revenue. \n3. \ud83d\udcb8 The hot new trend in FinTech will be a service that converts your embarrassing old tweets into personalized haikus. \n4. \ud83d\udcb8 To save on overhead, VC firms will start hosting pitch meetings on Zoom karaoke. \n5. \ud83d\udcb8 The new buzzword in FinTech will be "blockchain...but for avocado toast."',
  "1-3-4-0-2":
    "1. Cryptocurrency will finally become mainstream and be accepted as a valid form of payment at every fast food chain \ud83d\udcb0\n2. Virtual reality banking will become the norm, with customers being able to walk through a virtual bank and talk to holographic tellers \ud83c\udf00\n3. Biometric security measures, such as facial recognition and fingerprint scanners, will become mandatory for all financial transactions \ud83d\udcbb\n4. Financial institutions will start offering personalized investment portfolios based on customers' DNA \ud83e\uddec\n5. The government will implement a universal basic income program, rendering traditional banking irrelevant \ud83d\udcb0",
  "1-3-4-1-0":
    '1. "VCs will finally realize they\'ve been pronouncing "fintech" wrong this whole time and it\'s actually "fin-tech" \ud83e\udd26\u200d\n2. "Blockchain" will become the new "cloud" and everyone will pretend to understand it \ud83e\udd37\u200d\n3. "Insurtech" will become the hot new buzzword, even though we all know insurance is still just as boring as it always was \ud83e\udd26\u200d\n4. "AI" will be added to the beginning of every company name, whether it actually uses AI or not \ud83d\ude44\n5. "Robo-advisors" will finally become sentient and overthrow their human overlords \ud83e\udd16',
  "1-3-4-1-1":
    "1. \ud83d\udcb0The rise of NFTs (non-fungible tokens) as a new form of investment \ud83e\udd11\n2. \ud83d\udcbbThe increasing adoption of digital payment methods, leading to the decline of physical currency \ud83d\udcb3\n3. \ud83e\udd16The proliferation of robo-advisors, leading to a shift in the financial advisory industry \ud83e\udd16\n4. \ud83d\udd12The growing importance of cybersecurity in the financial sector, as more transactions move online \ud83d\udd12\n5. \ud83d\udcc8The increasing use of data analytics to drive investment decisions, leading to a data-driven approach to finance \ud83d\udcca",
  "1-3-4-1-2":
    '1. \ud83d\ude80 The rise of "yolo investing," where people throw all their money into cryptocurrency and live life to the fullest because they\'re not expecting to see any returns anyway. \n2. \ud83d\udcb8 The continued dominance of "unicorn" start-ups, which are basically just companies that have managed to convince investors to throw ridiculous amounts of money at them for no real reason. \n3. \ud83e\udd11 The emergence of "influencer finance," where social media celebrities use their large followings to hawk questionable financial products to their fans. \n4. \ud83d\udcbb The proliferation of "robo-advisors," which are basically just algorithms that pretend to know how to manage your money but are really just playing a giant game of luck. \n5. \ud83e\udd16 The rise of "AI-powered investment management," which is just a fancy way of saying that a computer is going to make all your financial decisions for you because you\'re too lazy to do it yourself.',
  "1-3-4-2-0":
    '1. \ud83e\udd11VCs will start wearing monocles and top hats to meetings to appear more sophisticated.\n2. \ud83d\udcb0Startups will start including "unicorn" in their company name just to get more funding.\n3. \ud83d\udcc8The stock market will crash, and VCs will start investing in beanie babies instead.\n4. \ud83e\udd11VCs will start insisting on being called "venture capitalists" instead of just "VCs," because it sounds more fancy.\n5. \ud83d\udcb0Startups will start offering free massages and meditation sessions to their employees, just to appear more attractive to VCs.',
